            "created": 1452094606000, 
            "description": "<p><b>NOTE: This is a special DSDC/SPDC joint event. Please RSVP on the SPDC event page\u00a0<a href=\"http://www.meetup.com/stats-prog-dc/events/227886991/\"><a href=\"http://www.meetup.com/stats-prog-dc/events/227886991/\" class=\"linkified\">http://www.meetup.com/stats-prog-dc/events/227886991/</a></a>\u00a0to get an accurate count for food and drinks.\u00a0FYI - The RSVP limit here is 0 (zero). Thank You.</b></p> <p>Please join us in the special DSDC/SDPC Event with Anthony Goldbloom, the CEO and Co-Founder of\u00a0<a href=\"http://www.kaggle.com/\">Kaggle</a>.</p> <p>Kaggle is a community of almost 450K data scientists who have built almost 2MM machine learning models to participate in our competitions. Data scientists come to Kaggle to learn, collaborate and develop the state of the art in machine learning. This talk will cover some of the lessons on winning techniques we have learned from the Kaggle community.</p> <p>SPDC is seeking sponsors. If you are interested in sponsoring this event please get in touch with us.</p> <p>6:30 - 7:00 - Mingle and Eat<br/>7:00 - 7:15 - Intros and Announcements<br/>7:15 - 8:30 - Presentation, Q&amp;A<br/>8:30ish - Data Drinks (TBD)</p>", 
